import React, { useState } from "react";
import { Link } from "react-router-dom";

const ManagePortfolio = () => {
  // State for image and video data
  const [imageData, setImageData] = useState([
    { id: 1, eventId: 1, title: "Image 1", url: "", description: "Image description" },
    { id: 2, eventId: 2, title: "Image 2", url: "", description: "Image description" },
    { id: 3, eventId: 3, title: "Image 3", url: "", description: "Image description" },
    { id: 4, eventId: 4, title: "Image 4", url: "", description: "Image description" },
    { id: 5, eventId: 5, title: "Image 5", url: "", description: "Image description" },
    { id: 6, eventId: 6, title: "Image 6", url: "", description: "Image description" },
    { id: 7, eventId: 7, title: "Image 7", url: "", description: "Image description" },
    { id: 8, eventId: 8, title: "Image 8", url: "", description: "Image description" },
    { id: 9, eventId: 9, title: "Image 9", url: "", description: "Image description" },
  ]);

  const [videoData, setVideoData] = useState([
    { id: 1, title: "Video 1", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 2, title: "Video 2", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 3, title: "Video 3", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 4, title: "Video 4", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 5, title: "Video 5", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 6, title: "Video 6", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 7, title: "Video 7", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 8, title: "Video 8", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 9, title: "Video 9", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
  ]);

  const [currentPageImage, setCurrentPageImage] = useState(1);
  const [currentPageVideo, setCurrentPageVideo] = useState(1);
  const itemsPerPage = 5; // Pagination

  // Image Pagination Logic
  const indexOfLastImage = currentPageImage * itemsPerPage;
  const indexOfFirstImage = indexOfLastImage - itemsPerPage;
  const currentImages = imageData.slice(indexOfFirstImage, indexOfLastImage);

  // Video Pagination Logic
  const indexOfLastVideo = currentPageVideo * itemsPerPage;
  const indexOfFirstVideo = indexOfLastVideo - itemsPerPage;
  const currentVideos = videoData.slice(indexOfFirstVideo, indexOfLastVideo);

  // Handlers for creating, updating, and deleting images and videos
  const handleCreateImage = () => {
    // Handle image creation (e.g., open a modal or form to add a new image)
  };

  const handleCreateVideo = () => {
    // Handle video creation (e.g., open a form to add a new YouTube link)
  };

  const handleUpdateImage = (id) => {
    // Handle image update
  };

  const handleUpdateVideo = (id) => {
    // Handle video link update
  };

  const handleDeleteImage = (id) => {
    setImageData(imageData.filter((image) => image.id !== id));
  };

  const handleDeleteVideo = (id) => {
    setVideoData(videoData.filter((video) => video.id !== id));
  };

  return (
    <div className="min-h-screen bg-gray-300 p-6">
      {/* Home Page Button */}
      <div className="mb-6">
        <Link
          to="/dashboard"
          className="bg-orange-400 text-white px-4 py-2 rounded-md hover:bg-orange-500 transition duration-300"
        >
          Go to Dashboard
        </Link>
      </div>

      {/* Main Heading: Manage Portfolio */}
      <h2 className="text-2xl font-bold mb-6 text-center">Manage Portfolio</h2>

      {/* Main Container: Flex Layout for Image and Video Sections */}
      <div className="flex justify-between gap-6">
        {/* Image Management Section */}
        <div className="w-1/2">
          <h3 className="text-xl font-semibold mb-4 text-center">Image Management</h3>
          <select className="p-2 rounded-md border border-gray-400 bg-white w-full">
            {[...Array(9)].map((_, index) => (
              <option key={index} value={index + 1}>
                Event ID {index + 1}
              </option>
            ))}
          </select>
          <button
            className="ml-4 bg-orange-400 text-white px-4 py-2 rounded-md"
            onClick={handleCreateImage}
          >
            Create Image
          </button>
          <table className="w-full table-auto text-left mt-4">
            <thead className="bg-orange-400 text-white">
              <tr>
                <th className="p-4">ID</th>
                <th className="p-4">Event ID</th>
                <th className="p-4">Title</th>
                <th className="p-4">URL</th>
                <th className="p-4">Actions</th>
              </tr>
            </thead>
            <tbody>
              {currentImages.map((image) => (
                <tr key={image.id}>
                  <td className="p-4">{image.id}</td>
                  <td className="p-4">{image.eventId}</td>
                  <td className="p-4">{image.title}</td>
                  <td className="p-4">{image.url}</td>
                  <td className="p-4">
                    <button
                      className="bg-orange-400 text-white px-4 py-2 rounded-md"
                      onClick={() => handleUpdateImage(image.id)}
                    >
                      Update
                    </button>
                    <button
                      className="ml-2 bg-red-500 text-white px-4 py-2 rounded-md"
                      onClick={() => handleDeleteImage(image.id)}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          {/* Image Pagination */}
          <div className="flex justify-between mt-4">
            <button
              className="bg-gray-400 text-white px-4 py-2 rounded-md"
              onClick={() => setCurrentPageImage(currentPageImage - 1)}
              disabled={currentPageImage === 1}
            >
              Previous
            </button>
            <button
              className="bg-gray-400 text-white px-4 py-2 rounded-md"
              onClick={() => setCurrentPageImage(currentPageImage + 1)}
              disabled={currentPageImage * itemsPerPage >= imageData.length}
            >
              Next
            </button>
          </div>
        </div>

        {/* Video Management Section */}
        <div className="w-1/2">
          <h3 className="text-xl font-semibold mb-4 text-center">Video Management</h3>
          <input
            type="text"
            placeholder="Enter YouTube link"
            className="p-2 rounded-md border border-gray-400 bg-white w-full"
          />
          <button
            className="ml-4 bg-orange-400 text-white px-4 py-2 rounded-md"
            onClick={handleCreateVideo}
          >
            Create Video Link
          </button>
          <table className="w-full table-auto text-left mt-4">
            <thead className="bg-orange-400 text-white">
              <tr>
                <th className="p-4">ID</th>
                <th className="p-4">Title</th>
                <th className="p-4">YouTube Link</th>
                <th className="p-4">Actions</th>
              </tr>
            </thead>
            <tbody>
              {currentVideos.map((video) => (
                <tr key={video.id}>
                  <td className="p-4">{video.id}</td>
                  <td className="p-4">{video.title}</td>
                  <td className="p-4">{video.youtubeLink}</td>
                  <td className="p-4">
                    <button
                      className="bg-orange-400 text-white px-4 py-2 rounded-md"
                      onClick={() => handleUpdateVideo(video.id)}
                    >
                      Update
                    </button>
                    <button
                      className="ml-2 bg-red-500 text-white px-4 py-2 rounded-md"
                      onClick={() => handleDeleteVideo(video.id)}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          {/* Video Pagination */}
          <div className="flex justify-between mt-4">
            <button
              className="bg-gray-400 text-white px-4 py-2 rounded-md"
              onClick={() => setCurrentPageVideo(currentPageVideo - 1)}
              disabled={currentPageVideo === 1}
            >
              Previous
            </button>
            <button
              className="bg-gray-400 text-white px-4 py-2 rounded-md"
              onClick={() => setCurrentPageVideo(currentPageVideo + 1)}
              disabled={currentPageVideo * itemsPerPage >= videoData.length}
            >
              Next
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ManagePortfolio;
